import logo from "../assets/logo.png";
export const Header=()=>{
    return (
        <header>
            <div className="bg-c1 py-3">
                <img className="inline" src={logo} alt=""/>
                <h1 className="text-amber-500">Jobbhy</h1>
            </div>
            
        </header>
    );
    }
